import React from 'react';
  
const CreateAcc = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
    >
      <h1>Welcome to GeeksforGeeks Blogs</h1>
    </div>
  );
};
  
export default CreateAcc;
